import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


//Setup Vars
const image = <img src='https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg' width='300px' height='250px' alt='' />
const title = 'Terminator';
const author = 'James Cameron'


function BookList() {
    return (
        <>
            <section className='books'>
                <Book
                    img={firstBook.image}
                    title={firstBook.title}
                    author={firstBook.author}
                />
                <Book
                    img={secondBook.image}
                    title={secondBook.title}
                    author={secondBook.author}
                />
            </section>
        </>
    )
}



const Book = (props) => {
    return (
        <article>
            <img src={props.img} alt='' />
            <h1>{props.title}</h1>
            <h1> {props.author}</h1>
        </article>

    )
}


ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
